import unittest
from unittest import TestCase

from chainconductor.web3.types import ERC165InterfaceID
from chainconductor.web3.util import (
    ERC165Functions,
    contract_implements_function,
    ERC1155MedataURIFunctions,
    contract_data_to_opcodes,
)


class MyTestCase(unittest.TestCase):
    def test_contract_implements_method_is_true_when_method_is_in_contract(self):
        contact_creation_code = ""  # noqa E501
        actual = contract_implements_function(
            contact_creation_code, ERC165Functions.SUPPORTS_INTERFACE.function_hash
        )
        self.assertTrue(actual)  # add assertion here

    def test_contract_implements_method_is_false_when_method_is_in_contract(self):
        contract_creation_code = ""  # noqa E501
        actual = contract_implements_function(
            contract_creation_code, ERC1155MedataURIFunctions.URI.function_hash
        )
        self.assertFalse(actual)  # add assertion here

    def test_invalid_contract_returns_true_if_function_defined_in_valid_potion(self):
        contract_creation_code = "0x6080630e89341c60"
        actual = contract_implements_function(
            contract_creation_code, ERC1155MedataURIFunctions.URI.function_hash
        )
        self.assertTrue(actual)


if __name__ == "__main__":
    unittest.main()


class TestERC165InterfaceID(TestCase):
    def test_get_by_value_is_enum_member_when_valid_value_provided(self):
        expected = ERC165InterfaceID.ERC721
        actual = ERC165InterfaceID.from_value(ERC165InterfaceID.ERC721.value)
        self.assertEqual(expected, actual)

    def test_get_by_value_is_none_when_invalid_value_provided(self):
        actual = ERC165InterfaceID.from_value("NOT A VALID MEMBER VALUE")
        self.assertIsNone(actual)


